import React, { Component } from 'react';
import PropTypes from 'prop-types';
import * as Highcharts from 'highcharts/highstock';

class LineChart extends Component {

	componentDidMount() {
		this.createChart();
	}

	componentDidUpdate() {
    this.createChart();
  }

	createChart() {
		let estimatedData = [];
		estimatedData = this.props.estimatedData.map(obj => {
			const date = obj['Date'].split("/");
			const dateInSeconds = new Date(`20${date[2]}`, +date[1] - 1, date[0]).getTime();
			return [dateInSeconds, obj['Estimated TWh per Year']];
		}).reverse();

		let minimumData = [];
		minimumData = this.props.minimumData.map(obj => {
			const date = obj['Date'].split("/");
			const dateInSeconds = new Date(`20${date[2]}`, +date[1] - 1, date[0]).getTime();
			return [dateInSeconds, obj['Minimum TWh per Year']];
		}).reverse();

		Highcharts.stockChart('chart', {
        rangeSelector: {
        	selected: 5
        },

        title: {
          text: this.props.title
		},
		plotOptions: {
            series: {
                compare: 'percent',
                showInNavigator: true
            }
        },	
        series: [{
            name: 'Estimated TWh per Year',
            data: estimatedData,
            tooltip: {
              valueDecimals: 3
            }
		},
		{
			name: 'Minimum TWh per Year',
            data: minimumData,
            tooltip: {
              valueDecimals: 3
            }
		}
	]
    });
	}

	render() {
		return (
			<div id='chart'>Highstock</div>
		);
	}
}

LineChart.propTypes = {
	data: PropTypes.array,
  	title: PropTypes.string
};

export default LineChart;
